import * as React from "react";

export default function MessageHolder(props: any) {
  return (
    <div className="Message-holder">
      {props.messages.map((msg: any) => {
        if (msg.sender === "user") {
          <li className="userMessage">{msg.text}</li>;
        } else {
          <li className="friendMessage">{msg.text}</li>;
        }
      })}
    </div>
  );
}
